function validate(entry){
    const count = (entry.password.match(new RegExp(entry.char, "g")) || []).length

    return entry.min <= count && count <= entry.max
}

function validate2(entry){
    var first = entry.password[entry.min - 1]
    var second = entry.password[entry.max - 1]

    return (first == entry.char && second != entry.char)
        || (second == entry.char &&  first!= entry.char)
}
